import React from 'react'
import classes from './CartButton.module.css'
import { FaShoppingCart } from 'react-icons/fa'

const CartButton = () => {
  return (
    <button>
      <FaShoppingCart />
      <span></span>
      <span></span>
    </button>
  )
}

export default CartButton
